export const UserRanked = ({ name, score }) => {
  return (
    <div className="rounded-xl w-30 mb-3 mr-8 font-montserrat ml-20 bg-[#D9D9D9] shadow-md ">
      <img></img>
      <p className="m-2">{name}</p>
      <p className="">{score}</p>
    </div>
  );
};
